/*
 * Modifies the TaggedValues of a package and its packages, elements, elements' attributes
 * and elements' connectors' connectorEnds.
 * Only tags prefLabel (da) and prefLabel (en)
 * @param {Package} package - The package to tag.
 * @param {String} lang - the primary language to use for tagging, (da) or (en).
 * @param {String} altLang - the secondary language to use for tagging, (da) or (en).
 */

function tagPackageName(package, lang){
	Session.Output("Tagging package " + package.name);

	//Define taggedValueName values
	var labelName = "label " + lang;	
	var prefLabelName = "prefLabel " + lang;
	var replaceExisting = true;

	//Tag package
	var packageElement = package.element;
	var packageName = packageElement.name;
	setTaggedValue(packageElement, labelName, stripName(packageName), replaceExisting);

	//Tag children packages
	var packages = package.packages;
	for(var i = 0; i < packages.count; i++){
		tagPackageName(packages.getat(i), lang);
	}

	//Tag elements
	var elements = package.elements;
	for(var i = 0; i < elements.count; i++){
		var element = elements.getat(i);
		var elementName = element.name;
		setTaggedValue(element, prefLabelName, stripName(elementName), replaceExisting);

		//Tag attributes
		var elementAttributes = element.attributes;
		for(var j = 0; j < elementAttributes.count; j++){
			var attribute = elementAttributes.getAt(j);
			var attributeName = attribute.name;
			setTaggedValue(attribute, prefLabelName, stripName(attributeName), replaceExisting);
		}

		//Tag connectorEnds
		var elementConnectors = element.connectors;
		for(var j = 0; j < elementConnectors.count; j++){
			var connector = elementConnectors.getat(j);
			var clientEnd = connector.clientend;
			var supplierEnd = connector.supplierend;
			if(clientEnd.role != ""){
				var clientEndName = clientEnd.role;
				setTaggedValue(clientEnd, prefLabelName, stripName(clientEndName), replaceExisting);
			}
			if(supplierEnd.role != ""){
				var supplierEndName = supplierEnd.role;
				setTaggedValue(supplierEnd, prefLabelName, stripName(supplierEndName), replaceExisting);
			}
		}
	}	
}

function tagPackageAlias(package, lang){
	Session.Output("Tagging package " + package.name);

	//Define taggedValueName values
	var labelName = "label " + lang;	
	var aliasName = "prefLabel " + lang;
	var replaceExisting = true;

	//Tag package
	var packageElement = package.element;
	var packageAlias = packageElement.alias;
	setTaggedValue(packageElement, labelName, stripName(packageAlias), replaceExisting);

	//Tag children packages
	var packages = package.packages;
	for(var i = 0; i < packages.count; i++){
		tagPackageAlias(packages.getat(i), lang);
	}

	//Tag elements
	var elements = package.elements;
	for(var i = 0; i < elements.count; i++){
		var element = elements.getat(i);
		var elementAlias = element.alias;
		setTaggedValue(element, aliasName, stripName(elementAlias), replaceExisting);

		//Tag attributes
		var elementAttributes = element.attributes;
		for(var j = 0; j < elementAttributes.count; j++){
			var attribute = elementAttributes.getAt(j);
			var attributeAlias = attribute.alias;
			setTaggedValue(attribute, aliasName, stripName(attributeAlias), replaceExisting);
		}

		//Tag connectorEnds
		var elementConnectors = element.connectors;
		for(var j = 0; j < elementConnectors.count; j++){
			var connector = elementConnectors.getat(j);
			var clientEnd = connector.clientend;
			var supplierEnd = connector.supplierend;
			if(clientEnd.role != ""){
				var clientEndAlias = clientEnd.Alias;
				setTaggedValue(clientEnd, aliasName, stripName(clientEndAlias), replaceExisting);
			}
			if(supplierEnd.role != ""){
				var supplierEndAlias = supplierEnd.Alias;
				setTaggedValue(supplierEnd, aliasName, stripName(supplierEndAlias), replaceExisting);
			}
		}
	}	
}

function tagPackageURIPrefixes(package){
	var elements = package.elements;
	var packages = package.packages;
	var packageNamespace = getTaggedValue(package.element, "namespace", "");
	var packageNamespacePrefix = getTaggedValue(package.element, "namespacePrefix", "");

	//Tag children packages
	for(var i = 0; i < packages.count; i++){
		tagPackageURIPrefixes(packages.getat(i));
	}

	//Tag elements
	for(var i = 0; i < elements.count; i++){
		var element = elements.getat(i);
		setURI(element, package);
		addPrefix(element, packageNamespacePrefix);

		//Tag attributes
		var elementAttributes = element.attributes;
		for(var j = 0; j < elementAttributes.count; j++){
			var attribute = elementAttributes.getAt(j);
			setURI(attribute, package);
			addPrefix(attribute, packageNamespacePrefix);
		}

		//Tag connectorEnds
		var elementConnectors = element.connectors;
		for(var j = 0; j < elementConnectors.count; j++){
			var connector = elementConnectors.getat(j);
			var clientEnd = connector.clientend;
			var supplierEnd = connector.supplierend;

			//Check existence of clientEnd by checking if they have a role
			//Checking for null is not possible, as connectors always have a clientEnd and supplierEnd
			if(clientEnd.role != ""){
				setURI(clientEnd, package);
				addPrefix(clientEnd, packageNamespacePrefix);
			}
			if(supplierEnd.role != ""){
				setURI(supplierEnd, package);
				addPrefix(supplierEnd, packageNamespacePrefix);
			}
		}
	}
}

function tagPackageNotes(package, lang){
	Session.Output("Tagging package " + package.name);

	//Define taggedValueName values
	var notesName = "definition " + lang;
	var replaceExisting = true;

	//Tag children packages
	var packages = package.packages;
	for(var i = 0; i < packages.count; i++){
		tagPackageNotes(packages.getat(i), lang);
	}

	//TODO: Set value of "definition (da)"/"definition (en)" to "<memo>"
	//TODO: Afterwards, set "definition (da)"/"definition (en)" TaggedValue.Notes to
	//object.notes

	//Tag elements
	var elements = package.elements;
	for(var i = 0; i < elements.count; i++){
		var element = elements.getat(i);
		var elementNotes = element.notes;
		Session.Output("Tagging element: " + element.name + ", elementNotes: " + elementNotes);
		setTaggedValue(element, notesName, "<memo>", replaceExisting);
		setTaggedValueNotes(element, notesName, elementNotes);

		//Tag attributes
		var elementAttributes = element.attributes;
		for(var j = 0; j < elementAttributes.count; j++){
			var attribute = elementAttributes.getAt(j);
			var attributeNotes = attribute.notes;
			setTaggedValue(attribute, notesName, "<memo>", replaceExisting);
			setTaggedValueNotes(attribute, notesName, attributeNotes);
		}

		//Tag connectorEnds
		var elementConnectors = element.connectors;
		for(var j = 0; j < elementConnectors.count; j++){
			var connector = elementConnectors.getat(j);
			var clientEnd = connector.clientend;
			var supplierEnd = connector.supplierend;
			if(clientEnd.role != ""){
				var clientEndNotes = clientEnd.rolenotes;
				setTaggedValue(clientEnd, notesName, "<memo>", replaceExisting);
				setTaggedValueNotes(clientEnd, notesName, clientEndNotes);
			}
			if(supplierEnd.role != ""){
				var supplierEndNotes = supplierEnd.rolenotes;
				setTaggedValue(supplierEnd, notesName, "<memo>", replaceExisting);
				setTaggedValueNotes(supplierEnd, notesName, supplierEndNotes);
			}
		}
	}
}

