function mainMethod(){
	var lang = "(da)";
	var treeSelectedType = Repository.GetTreeSelectedItemType();

	switch (treeSelectedType) {
		case otPackage :
		{
			var package = Repository.GetTreeSelectedPackage();
			hiddenToDeprecated(package);
			var projectInterface = Repository.GetProjectInterface();
			synchronizePackage(projectInterface, package);
 			break;
		}
		default :
		{
			Session.Output("Entered default case");
			Session.Prompt("This script only supports packages", promptOK );
		}
	}
}

function hiddenToDeprecated(package){
	//Tag child packages
	var packages = package.packages;
	for(var i = 0; i < packages.count; i++){
		hiddenToDeprecated(packages.getat(i));
	}

	//Tag elements
	var elements = package.elements;
	for(var i = 0; i < elements.count; i++){
		var element = elements.getat(i);
		deleteTaggedValue(element, "hiddenLabel (da)");
		deleteTaggedValue(element, "hiddenLabel (en)");

		//Tag attributes
		var elementAttributes = element.attributes;
		for(var j = 0; j < elementAttributes.count; j++){
			var attribute = elementAttributes.getAt(j);
			deleteTaggedValue(attribute, "hiddenLabel (da)");
			deleteTaggedValue(attribute, "hiddenLabel (en)");
		}

		//Tag connectorEnds
		var elementConnectors = element.connectors;
		for(var j = 0; j < elementConnectors.count; j++){
			var connector = elementConnectors.getat(j);
			var clientEnd = connector.clientend;
			var supplierEnd = connector.supplierend;
			if(clientEnd.role != ""){
				deleteTaggedValue(clientEnd, "hiddenLabel (da)");
				deleteTaggedValue(clientEnd, "hiddenLabel (en)");
			}
			if(supplierEnd.role != ""){
				deleteTaggedValue(supplierEnd, "hiddenLabel (da)");
				deleteTaggedValue(supplierEnd, "hiddenLabel (en)");
			}
		}
	}
}

function deleteTaggedValue(object, taggedValueName){
	var taggedValue;
	if ( object != null && taggedValueName.length > 0 )
	{
		var taggedValueValue;
		var objectTaggedValues = object.TaggedValues;
		for(var i = 0; i < objectTaggedValues.count; i++){
			if(objectTaggedValues.getat(i).Tag == taggedValueName || objectTaggedValues.getat(i).Name == taggedValueName){
				objectTaggedValues.Delete(i);
				objectTaggedValues.Refresh();
				break;
			}
		}
	}
}

//Run the method
mainMethod();

