/*
 * Script Name: Copy from concept
 * Author: Peter West-Nielsen
 * Purpose: To copy information from concepts in the ConceptModel into the CoreModel or Vocabulary using the wasDerivedFrom tag
 * Date: 2018-09-18
 */

var conceptModels = [];
var warningArray = [];

function main()
{
	Session.Output("\n *** Copy from concept START ***");
	Repository.EnsureOutputVisible( "Script" );

	var package as EA.Package;
	package = Repository.GetTreeSelectedPackage();

	var models as EA.Collection;
	models = Repository.Models;
	var model as EA.Package;
	model = models.GetAt(0);

	findConceptModels(model);

	if(package != null)
	{
		Session.Output( "package name : "+ package.Name );

		var stereotypes = package.StereotypeEx;

		var CoreModel = stereotypes.match("CoreModel");
		var Vocabulary = stereotypes.match("Vocabulary");


		if(CoreModel == "CoreModel" ||  Vocabulary == "Vocabulary" )
		{
			var thisPackages as EA.Collection;
			var subPackage as EA.Package;
			GetInfoFromConcept(package);

			thisPackages = package.Packages;
			for (var i = 0 ; i < thisPackages.Count ; i++)
			{
				subPackage = thisPackages.GetAt(i);	

				if(subPackage != null)
				{
					Session.Output( " subPackage name : "+ subPackage.Name );
					GetInfoFromConcept(subPackage);
				}
			}
		}
		else
		{
			Session.Output( "Model should be of stereotype CoreModel or Vocabulary");
			Session.Output( "package Stereotypes : "+ package.StereotypeEx );
		}
	}

	Session.Output("\n" );
	for (var j = 0 ; j < warningArray.length ; j++)
	{
		Session.Output("Warning : " + warningArray[j] );
	}	

	Session.Output("\n *** Copy from concept END***");
}

function GetInfoFromConcept(package)
{
	var elements as EA.Collection;
	var currentElement as EA.Element;
	elements = package.Elements;

	for (var i = 0 ; i < elements.Count ; i++)
	{
		currentElement = elements.GetAt(i);
		wasDerivedFrom = GetTaggedValue(currentElement, "wasDerivedFrom");;

		if(wasDerivedFrom.value != "noValue")
		{
			findConcept(currentElement, wasDerivedFrom);
		}
		else
		{
			warning = "No matching concept indicated for Element : "+ currentElement.Name;
			warningArray.push(warning);
		}

		var attributes as EA.Collection;
		var attribute as EA.Attribute;
		attributes = currentElement.Attributes;
		for (var k = 0; k < attributes.Count; k++) 
		{
			attribute = attributes.GetAt(k);
			wasDerivedFrom = GetTaggedValue(attribute, "wasDerivedFrom");

			if(wasDerivedFrom.value != "noValue")
			{
				findConcept(attribute, wasDerivedFrom);
			}
			else
			{
				warning = "No matching concept indicated for Attribute : "+ attribute.Name;
				warningArray.push(warning);
			}

		}

		var connectors as EA.Collection;
		var currentConnector as EA.Connector;
		connectors = currentElement.Connectors;
		for (var j = 0 ; j < connectors.Count ; j++)
		{
			currentConnector = connectors.GetAt(j);	

			clientRole = currentConnector.ClientEnd;
			wasDerivedFrom = GetRoleTaggedValue(clientRole, "wasDerivedFrom");
			if(wasDerivedFrom.value != "noValue")
			{
				//Session.Output("  clientRole name: "+ clientRole.Role + " WasDerivedFrom : "+ wasDerivedFrom.value);
				findConceptRole(clientRole, wasDerivedFrom);
			}
			else
			{
				if(clientRole.Role.length > 0)
				{
					warning = "No matching concept indicated for Role : "+ clientRole.Role;
					warningArray.push(warning);
				}
			}

			supplierRole = currentConnector.SupplierEnd;
			wasDerivedFrom = GetRoleTaggedValue(supplierRole, "wasDerivedFrom");
			if(wasDerivedFrom.value != "noValue")
			{
				//Session.Output("  supplierRole name: "+ supplierRole.Role + " WasDerivedFrom : "+ wasDerivedFrom.value);
				findConceptRole(supplierRole, wasDerivedFrom);
			}
			else
			{
				if(supplierRole.Role.length > 0)
				{
					warning = "No matching concept indicated for Role : "+ supplierRole.Role;
					warningArray.push(warning);
				}
			}
		}

	}	
}


function findConcept(thing, wasDerivedFrom)
{
	var package as EA.Package;
	var concepts as EA.Collection;
	var concept as EA.Element;

	conceptFound = false;

	var i = 0;
	while( i < conceptModels.length)
	{
		package = Repository.GetPackageByGuid(conceptModels[i]);
		//Session.Output( "i : " + i + " " + conceptModels[i] +"packageName : "+ package.Name );

		concepts = package.Elements;

		for (var j = 0 ; j < concepts.Count ; j++)
		{
			concept = concepts.GetAt(j);
			conceptUri = GetTaggedValue(concept, "URI");
			//Session.Output("Concept : " + concept.Name + " URI : " + conceptUri.value  );
			if(wasDerivedFrom.value != "noValue" && wasDerivedFrom.value == conceptUri.value)
			{
				conceptFound = true;

				Session.Output("Concept : " + concept.Name + ", in conceptModel : " + package.Name + ", is concept for : " + thing.Name );

				CopyTaggedValue(thing, concept, "altLabel (da)");
				CopyTaggedValue(thing, concept, "applicationNote (da)");
				CopyTaggedValue(thing, concept, "definition (da)");
				CopyTaggedValue(thing, concept, "deprecatedLabel (da)");
				CopyTaggedValue(thing, concept, "example (da)");
				CopyTaggedValue(thing, concept, "label (da)");
				CopyTaggedValue(thing, concept, "prefLabel (da)");

				CopyTaggedValue(thing, concept, "altLabel (en)");
				CopyTaggedValue(thing, concept, "applicationNote (en)");
				CopyTaggedValue(thing, concept, "definition (en)");
				CopyTaggedValue(thing, concept, "deprecatedLabel (en)");
				CopyTaggedValue(thing, concept, "example (en)");
				CopyTaggedValue(thing, concept, "label (en)");
				CopyTaggedValue(thing, concept, "prefLabel (en)");

				CopyTaggedValue(thing, concept, "legalSource");
				CopyTaggedValue(thing, concept, "source");
			}

		}		
		i++;
	}

	if(conceptFound == false)
	{
		warning = "No concept with URI = " + wasDerivedFrom.value + " found for " + thing.name;
		warningArray.push(warning);
	}
}

function findConceptRole(role, wasDerivedFrom)
{
	var package as EA.Package;
	var concepts as EA.Collection;
	var concept as EA.Element;

	var i = 0;
	while( i < conceptModels.length)
	{
		package = Repository.GetPackageByGuid(conceptModels[i]);
		//Session.Output( "i : " + i + " " + conceptModels[i] +"packageName : "+ package.Name );

		concepts = package.Elements;

		for (var j = 0 ; j < concepts.Count ; j++)
		{
			concept = concepts.GetAt(j);
			conceptUri = GetTaggedValue(concept, "URI");
			//Session.Output("Concept : " + concept.Name + " URI : " + conceptUri.value  );
			if(wasDerivedFrom.value != "noValue" && wasDerivedFrom.value == conceptUri.value)
			{
				Session.Output("Concept : " + concept.Name + ", in conceptModel : " + package.Name + ", is concept for : " + role.Role );

				CopyTaggedValueRole(role, concept, "altLabel (da)");
				CopyTaggedValueRole(role, concept, "applicationNote (da)");
				CopyTaggedValueRole(role, concept, "definition (da)");
				CopyTaggedValueRole(role, concept, "deprecatedLabel (da)");
				CopyTaggedValueRole(role, concept, "example (da)");
				CopyTaggedValueRole(role, concept, "label (da)");
				CopyTaggedValueRole(role, concept, "prefLabel (da)");

				CopyTaggedValueRole(role, concept, "altLabel (en)");
				CopyTaggedValueRole(role, concept, "applicationNote (en)");
				CopyTaggedValueRole(role, concept, "definition (en)");
				CopyTaggedValueRole(role, concept, "deprecatedLabel (en)");
				CopyTaggedValueRole(role, concept, "example (en)");
				CopyTaggedValueRole(role, concept, "label (en)");
				CopyTaggedValueRole(role, concept, "prefLabel (en)");

				CopyTaggedValueRole(role, concept, "legalSource");
				CopyTaggedValueRole(role, concept, "source");
			}
		}		
		i++;
	}
}

function CopyTaggedValue(thing, concept, tagName)
{
	var conceptTagValue;
	conceptTagValue = GetTaggedValue(concept, tagName);

	var taggedValue as EA.TaggedValue;
	var taggedValues as EA.Collection;

	taggedValue = null;
	taggedValueValue = null;
	taggedValues = thing.TaggedValues;
	for (var i = 0 ; i < taggedValues.Count ; i++)
	{
		taggedValue = taggedValues.GetAt(i);
		if(taggedValue.Name == tagName) 
		{
			if(conceptTagValue.valueType == "value")
			{
				taggedValue.Value = conceptTagValue.value;
			}
			if(conceptTagValue.valueType == "memo")
			{
				taggedValue.Notes = conceptTagValue.value;
			}
			taggedValue.Update;
		}		
	}
}


function CopyTaggedValueRole(role, concept, tagName)
{
	var conceptTagValue;
	conceptTagValue = GetTaggedValue(concept, tagName);
	if(conceptTagValue.value != "noValue")
	{
		//Session.Output( "roleConceptTag name "+tagName+" : " + conceptTagValue.value + " is of type : " + conceptTagValue.valueType);

		var taggedValue as EA.RoleTag;
		var taggedValues as EA.Collection;

		taggedValue = null;
		taggedValueValue = null;
		taggedValues = role.TaggedValues;
		for (var i = 0 ; i < taggedValues.Count ; i++)
		{
			taggedValue = taggedValues.GetAt(i);

			if(taggedValue.Tag == tagName) 
			{
				if(conceptTagValue.valueType == "value")
				{
					taggedValue.Value = conceptTagValue.value;
				}
				if(conceptTagValue.valueType == "memo")
				{
					taggedValue.Value = "<memo>$ea_notes=" + conceptTagValue.value;
				}
				taggedValue.Update;
			}		
		}
	}
}


function GetTaggedValue(thing, tagName)
{
	var taggedValue as EA.TaggedValue;
	var taggedValues as EA.Collection;
	var taggedValueProfiles as EA.TaggedValue;

	taggedValue = null;
	taggedValueValue = null;
	taggedValues = thing.TaggedValues;
	for (var i = 0 ; i < taggedValues.Count ; i++)
	{
		taggedValue = taggedValues.GetAt(i);
		if(taggedValue.Name == tagName) 
		{
			taggedValueValue = taggedValue.Value;
			if(taggedValueValue.length > 0)
			{
				if(taggedValueValue == "<memo>")
				{
					if(taggedValue.Notes.length > 0)
					{
						return {valueType : "memo", value : taggedValue.Notes};
					}
				}
				else
				{
					return {valueType : "value", value : taggedValueValue};
				}
			}
		}		
	}

	return {valueType : "novalue", value : "noValue"};
}


function GetRoleTaggedValue(role, tagName)
{
	var taggedValue as EA.RoleTag;
	var taggedValues as EA.Collection;

	taggedValue = null;
	taggedValueValue = null;
	taggedValues = role.TaggedValues;
	for (var i = 0 ; i < taggedValues.Count ; i++)
	{
		taggedValue = taggedValues.GetAt(i);
		//Session.Output( "RoleTagValue Name : " + taggedValue.Tag + " RoleTagValue Value : " + taggedValue.Value + " RoleTagValue Notes : " + taggedValue.Notes );
		if(taggedValue.Tag == tagName) 
		{
			taggedValueValue = taggedValue.Value;
			if(taggedValueValue.length > 0 && taggedValue.Value != "$ea_notes=")
			{
				if(taggedValueValue == "<memo>")
				{
					return {valueType : "memo", value : taggedValue.Notes};
				}
				else
				{
					return {valueType : "value", value : taggedValueValue};
				}
			}
		}		
	}

	return {valueType : "novalue", value : "noValue"};
}

function findConceptModels(package)
{
	var packages as EA.Collection;
	packages = package.Packages;

	var subPackage as EA.Package;
	var i = 0;
	while(i < packages.Count)
	{
		subPackage = packages.GetAt(i);
		if(subPackage.StereotypeEx == "ConceptModel")
		{
			conceptModels.push(subPackage.PackageGUID);
		}

		findConceptModels(subPackage)
		i++;
	}
}

main();

