function FindTags(element){

	var taggedValue as EA.TaggedValue;

	var taggedValues = element.taggedValues;

	for(var j=0;j<taggedValues.count;j++){	

		var taggedValue = taggedValues.GetAt(j);
//		Session.Output(taggedValue.Name);

		if (taggedValue.Name.match(/definition.*/)){

			var definition = taggedValue.Notes;
			taggedValue.Notes = LowerCase(definition);
			taggedValue.Update;

		}
		if (taggedValue.Name.match(/.*Label.*/)){

			var label = taggedValue.Value;
			taggedValue.Value = LowerCase(label);
			taggedValue.Update;

		}

	}
}

function LowerCase(string){

	var newString = "";

		var initial = string.substring(0,1);
		var rest = string.substring(1,string.length);
//		Session.Output(rest);
		var lowercase = initial.toLowerCase();
		newString = lowercase + rest;


	return newString;

}

