function mainMethod(){
	var lang = "(da)";
	var treeSelectedType = Repository.GetTreeSelectedItemType();

	switch (treeSelectedType) {
		case otPackage :
		{
			var pack = Repository.GetTreeSelectedPackage();
			tagPackageName(pack, lang);
			var projectInterface = Repository.GetProjectInterface();
			synchronizePackage(projectInterface, pack);
 			break;
		}
		default :
		{
			Session.Output("Entered default case");
			Session.Prompt("This script only supports packages", promptOK );
		}
	}
}

//Run the method
mainMethod();

