function tagPackageSubClassOf(package){
	var replaceExisting = false;
	var elements = package.elements;
	for(var i = 0; i < elements.count; i++){
		var element = elements.getat(i);
		var connectors = element.connectors;
		for(var j = 0; j < connectors.count; j++){
			var connector = connectors.getat(j);
			if(connector.type == "Generalization"){
				//Check that client is subclass
				var clientID = connector.clientID;
				if(clientID == element.elementID){
					//Retrieve superclass element from repository
					//and check that it has an URI
					//Note: may need to check if URI != null as well (if tag does not exist)
					var supplierID = connector.supplierID;
					var supplierElement = Repository.GetElementByID(supplierID);
					var supplierElementURI = getTaggedValue(supplierElement, "URI", "")
					if(supplierElementURI != ""){
						//Finally, check if taggedValue already exists with this value

						if(!taggedValueValueExists(element, "subClassOf", supplierElementURI)){
							setTaggedValue(element, "subClassOf", supplierElementURI, replaceExisting);
						}//I
					}//am
				}//so
			}//sorry
		}//about
	}//this
}

/*
 * Modifies the TaggedValue with name "URI" according to pre-defined rules
 * @param {Object} object - The object to be modified
 * @param {String} package - The package containing the object. Used to find namespace of object
 */

function setURI(object, package){
	var namespace = getTaggedValue(package.element, "namespace", "");
	var namespacePrefix = getTaggedValue(package.element, "namespacePrefix", "")
	Session.Output("Entered setURI");
	//Retrieve object name and prefix (if existing)
	//prefixArray contains every match of a prefix (i.e. any number of characters followed by a semicolon)
	//However, it should either be null (i.e. no matches) or contain one element (one match found)
	if(object.objecttype == otConnectorEnd){
			objectName = object.role;
	}
	else {
		objectName = object.name;
	}
	var objectNamePrefixArray = objectName.match(/^.*:/);

	//Check if object has a prefix. If it does, strip it from name and set URI
	if (objectNamePrefixArray == null){
		var objectNameStripped = stripPrefix(objectName);
		var URI = namespace + objectNameStripped;
		var replaceExisting = true;
		setTaggedValue(object, "URI", URI, replaceExisting);
	}
	//else, check if prefix matches namespace prefix
	else {
		var objectNamePrefix = objectNamePrefixArray[0];
		//Trim ":" from prefix
		objectNamePrefix = objectNamePrefix.substring(0, objectNamePrefix.length-1);

		//Check that prefix of object matches prefix of namespace.
		//If not, object is foreign and URI should not be modified
		if(namespacePrefix == objectNamePrefix){
			//Strip prefix from name
			var objectNameStripped = stripPrefix(objectName);
			//Set URI to namespace + stripped name
			var URI = namespace + objectNameStripped;
			var replaceExisting = true;
			setTaggedValue(object, "URI", URI, replaceExisting);
		}
		//else, element is foreign
		//If it's an element, color it RGB(234,240,255)
		//Bad practice to have this in setURI, should be moved to own function. #ohwell
		else if (object.objecttype == otElement && package.element.stereotype != null && (package.element.stereotype == "Vocabulary" || package.element.stereotype == "CoreModel")) { 
			var scope = 1; //Modify for all diagrams
			var item = 0; //Modify background
			var value = (255<<16)+(240<<8)+234; //Background color
			object.setAppearance(scope, item, value);
		}
	}
}

/*
 * Modifies the name of an object to include the value of the "namespacePrefix"
 * TaggedValue of the package containing the object.
 * @param {Object} object - The object to be modified
 * @param {String} package - The package containing the object. Used to find namespacePrefix
 */

function addPrefix(object, packagePrefix) {
	Session.Output("Entered addPrefix");
	//Check if package has a prefix. If not, don't do anything
	if (packagePrefix != "" && packagePrefix != null){
		var objectName;
		if(object.objecttype == otConnectorEnd){
			objectName = object.role;
		}
		else {
			objectName = object.name;
		}

		//Check if prefix already has been added. If so, jump to end of loop content
		var objectNamePrefixArray = objectName.match(/^.*:/);
		//Check if object has a prefix. If not, add it
		if (objectNamePrefixArray == null){
			if(object.objecttype == otConnectorEnd){
				object.role = packagePrefix + ":" + objectName;
			}
			else {
				object.name = packagePrefix + ":" + objectName;
			}
		}
		object.Update();
	}	
}

/*
 * Removes the namespace prefix from a string, using a regular expression
 * that matches the pattern used by namespacePrefix.
 * @param {String} objectName - The string to be stripped
 * @return {String} - objectName string with the first : and any characters before it removed.
 */

function stripPrefix(objectName){
	return objectName.replace(/^.*:/, "");
}

/*
Updates Plus-profil level 2 models to FDA-profil models (according to model rules v2)
Replacing stereotypes Individual, OwlClass, DatatypeProperty, ObjectProperty with ModelElement
Replacing RdfsResource (when alone) with Concept
Copying tagged values to new stereotypes
 @param {Object} package - package selected in Project Browser
*/

function updateToV2(package){

	Session.Output("Replacing stereotypes, transfering tagged values in " + package.Name);
	var ignoredTags = "transitiveProperty,inverseFunctionalProperty,transitiveProperty,functionalProperty,symmetricProperty,subClassOf,equivalentClass,equivalentProperty,subPropertyOf,domain,range,inverseOf,type";

	var elements = package.Elements;
	Session.Output("Antal elementer: " + elements.Count);
	for(var fi = 0; fi < elements.Count; fi++){
		var element = elements.GetAt(fi);
		var elementName = element.Name;
		Session.Output("###############################################");
		Session.Output("Element: " + elementName + " has stereotype : " + element.StereotypeEx);
		var aETaggedValues = new Array(0);
		var oETaggedValues = element.TaggedValues; 
//Element: capture tagged values		
		for(var t= 0; t < oETaggedValues.Count; t++){
			var tag = oETaggedValues.GetAt(t);
			if (ignoredTags.search(tag.Name) < 0){	
				if (tag.Value == "<memo>" && tag.Notes != "")
					{var pushArray = new Array( "memo", tag.Name   , tag.Notes );
						aETaggedValues.push(pushArray);
						}
				if (tag.Value != "<memo>" && tag.Value != "")
					{ var pushArray = new Array( "256", tag.Name , tag.Value );
						aETaggedValues.push(pushArray);
						}
			}
		}
//Element: report tagged values
		if (aETaggedValues.length > 0) 
			{
				Session.Output("  Tag values found: ")
				for(var p= 0; p < aETaggedValues.length; p++)
					{
						Session.Output("   [" + aETaggedValues[p][0] + "]: (" +  aETaggedValues[p][1] + " : " + aETaggedValues[p][2] + ")");
					}
			}
		else { Session.Output("  Found no tag values")
			}
//Element: Replace stereotypes

		var elUpdate = false;

		if (element.StereotypeEx.search("OwlClass") != -1)	{
			element.StereotypeEx = "FDAProfil::ModelElement";
			elUpdate = element.Update();
			Session.Output( "Element has  OwlClass -> all stereotypes replaced by " + element.StereotypeEx  + "" );}
		if (element.StereotypeEx.search("Individual") != -1)	{
			element.StereotypeEx = "FDAProfil::ModelElement";
			elUpdate = element.Update();
			Session.Output("Element has  Individual -> all stereotypes replaced by " + element.StereotypeEx  + "" );}	
		if (element.StereotypeEx.search("OwlClass") == -1 && element.StereotypeEx.search("Individual") == -1 && element.StereotypeEx.search("RdfsResource") != -1 )	{
