				if (ignoredTags.search(tag.Tag) < 0){	
					if (tag.Value.substr(0,6) == "<memo>" && tag.Value.substr(16) != "")
						{var pushArray = new Array("memo", tag.Tag ,  tag.Value.substr(16) );
							aCCTaggedValues.push(pushArray);
