/*Function for setting the value of a TaggedValue
Custom function as JScript-TaggedValue does not provide support for e.g. connectorEnd
April 2019: PB: Updated to work with <memo> type tags
 * @param {Object} object - The object to examine
 * @param {String} taggedValueName - the taggedValue to search for
 * @param {String} taggedValueValue - value to go into taggedValue - also for memo type taggedValue 
 * @param {boolean} replaceExisting - if the an existing tagged value should be updated or a new shoud be added
 * @param {boolean} memoType - is the taggedValue of type memo: longer then 256 characters; value should thus be placed in tag.notes
*/

function setTaggedValue(object, taggedValueName, taggedValueValue, replaceExisting, memoType){
	Session.Output("603 Object: " + object.Name + ", tagName: " + taggedValueName + ", value: " +  taggedValueValue + ", replace: " + replaceExisting + ", isMemo: " + memoType);
	if ( object != null && taggedValueName.length > 0 )
	{
		var taggedValue = null;
		var objectTaggedValues = object.TaggedValues;
		Session.Output("608: tagval count: " + objectTaggedValues.count);
		if(object.objectType == otConnectorEnd)
		{//CS Memo: comment (da)modsvarer NEM-KONTO-TYPE	

			for(var i = 0; i < objectTaggedValues.count; i++)
			{
				if(objectTaggedValues.getAt(i).Tag == taggedValueName)
				{
					if(memoType)
					{
						taggedValue = objectTaggedValues.getat(i);
						taggedValue.Value = "<memo>$ea_notes=" + taggedValueValue;
						taggedValue.Update();
						object.TaggedValues.Refresh();
						break;
					}
					else
					{
						taggedValue = objectTaggedValues.getat(i);
						taggedValue.Value = taggedValueValue;
						taggedValue.Update();
						object.TaggedValues.Refresh();
						break;
					}

				}
			}
		}
		else
		{
			for(var i = 0; i < object.TaggedValues.count; i++)
			{
				Session.Output("a:" + i + ":" + object + ":" + object.objectType);
				var TagVa = object.TaggedValues.GetAt(i);
				Session.Output("b" + i + ":" + object.TaggedValues.GetLastError());
				Session.Output("#" + i + ":" + object.TaggedValues.count);

				Session.Output("name:" + TagVa.Name);
				Session.Output(" to be " + taggedValueName);
				if(object.TaggedValues.getat(i).Name == taggedValueName)
				{
					if(memoType)
					{
						taggedValue = objectTaggedValues.getat(i);
						taggedValue.Value = "<memo>";
						taggedValue.Notes = taggedValueValue;
						taggedValue.Update();
						object.TaggedValues.Refresh();
						break;
					}
					else
					{
						taggedValue = object.TaggedValues.getat(i);
						taggedValue.Value = taggedValueValue;
						taggedValue.Update();
						object.TaggedValues.Refresh();
						break;
					}	
				}
			}
		}
		if ( taggedValue == null || (!replaceExisting))
		{
			Session.Output("Adding new taggedValue. " + taggedValueName + ", " + taggedValueValue);
			taggedValue = object.TaggedValues.AddNew(taggedValueName, taggedValueValue);
			taggedValue.Update();
			object.TaggedValues.Refresh();
		}


	}
}

/*
 * Returns the first taggedValue with name taggedValueName
 * @param {Object} object - The object to examine
 * @param {String} taggedValueName - the taggedValue to search for
 * @param {String} defaultValue - the result to return if no matching taggedValue is found
 */
function getTaggedValue(object, taggedValueName, defaultValue)
{
	var result = defaultValue;
	var taggedValue;
	if ( object != null && taggedValueName.length > 0 )
	{
		var taggedValueValue;
		var objectTaggedValues = object.TaggedValues;
		for(var i = 0; i < objectTaggedValues.count; i++){
			if(objectTaggedValues.getat(i).FQname == taggedValueName || objectTaggedValues.getat(i).name == taggedValueName){
				taggedValue = objectTaggedValues.getat(i);
				break; //bad practice
			}
		}
		if ( taggedValue != null ) result = taggedValue.Value;
	}
	return result;	
}

function stripName(string){
	var result = stripPrefix(string).replace(/([a-z])([A-Z])/g, '$1 $2').toLowerCase();
	return result;
}

/*
 * Check if an object has a taggedValue with a specific taggedValueValue
 * @param {Object} object - The object to examine
 * @param {String} taggedValueName - Only check taggedValue with the passed taggedValueName 
 * @param {String} taggedValueValue - Compare taggedValues with the passed taggedValueValue
 * @return {Boolean} - whether a taggedValue with the 
 */

function taggedValueValueExists(object, taggedValueName, taggedValueValue){
	var taggedValues = object.taggedvalues;
	var tempVal = "";
	var tempName = "";
	for(var i = 0; i < taggedValues.count; i++){
		tempVal = taggedValues.getat(i).value;
		tempName = taggedValues.getat(i).name;
		if(tempVal == taggedValueValue && tempName == taggedValueName){
			//bad practice
			return true;
		}
	}
	return false;
}

/*
 * Set the notes of a tagged value
 * @param {Object} object - The object to modify
 * @param {String} taggedValueName - the taggedValue to modify. If multiple exist, all are modified
 * @param {String} taggedValueNotes - the notes to insert
 */
function setTaggedValueNotes(object, taggedValueName, taggedValueNotes){
	var taggedValues = object.taggedvalues;
	var taggedValue;
	for(var i = 0; i < taggedValues.count; i++){
		taggedValue = taggedValues.getat(i);
		if(taggedValue.name == taggedValueName){
			taggedValue.Notes = taggedValueNotes;
			taggedValue.Update();
		}
	}
}

function synchronizePackage(projectInterface, package){
	var packageGUIDXML = projectInterface.GUIDtoXML(package.PackageGUID);
	projectInterface.SynchronizePackage(packageGUIDXML, "children=1"); 
}




