 function addStereotypes(package){


	Session.Output("Working on package " + package.name);
	Session.Output("Adding stereotypes");

	var elements = package.elements;
	for(var i = 0; i < elements.count; i++){
		var element = elements.getat(i);
		var elementName = element.name;
		Session.Output("Element: " + elementName + " has stereotype : " + element.stereotypeEx);

		if (element.stereotypeEx.search("OwlClass") == -1)	{
			element.stereotypeEx = "OwlClass, " + element.stereotypeEx;
			element.Update();
			Session.Output("Adding OwlClass");}
		else {Session.Output("Adding nothing");} 

		//var elementConnectors = element.connectors;
		//Session.Output(i + "  Element: " + elementName + "(" + elementConnectors.count + " connectors;   ElementID: " + element.elementID)
		for(var j = 0; j < element.attributes.count; j++){
			var attribute = element.attributes.getat(j);
			Session.Output("    Attribute: " + attribute.name + " has stereotype : " + attribute.stereotypeEx);

			if (attribute.stereotypeEx.search("DatatypeProperty") == -1)	{
				attribute.stereotypeEx = "DatatypeProperty, " + attribute.stereotypeEx;
				attribute.Update();
				Session.Output("    - Adding 'DatatypeProperty'");}
			else {Session.Output("    - Adding nothing");} 
		}

		var elementConnectors = element.connectors;
		//Session.Output(i + "  Element: " + elementName + "(" + elementConnectors.count + " connectors;   ElementID: " + element.elementID)
		for(var k = 0; k < elementConnectors.count; k++){
			var connector = elementConnectors.getat(k);
			//apparently, supplierEnd denotes the Target role...
			Session.Output("        ConnectorEnd: " + connector.clientEnd.role + " has stereotype : " + connector.clientEnd.stereotypeEx);

			if ((connector.clientEnd.role != "") && (connector.clientEnd.stereotypeEx.search("ObjectProperty") == -1))	{

				connector.clientEnd.stereotypeEx = "ObjectProperty, " + connector.clientEnd.stereotypeEx;

				Session.Output("        - Adding 'ObjectProperty'");}
			else {Session.Output("        - Adding nothing");} 
			Session.Output("        ConnectorEnd: " + connector.supplierEnd.role + " has stereotype : " + connector.supplierEnd.stereotypeEx);

			if ((connector.supplierEnd.role != "") && (connector.supplierEnd.stereotypeEx.search("ObjectProperty") == -1))	{

				connector.supplierEnd.stereotypeEx = "ObjectProperty, " + connector.supplierEnd.stereotypeEx;

				Session.Output("        - Adding 'ObjectProperty'");}
			else {Session.Output("        - Adding nothing");} 
			connector.Update();

			}


			//Session.Output(j + "conn: " + connectorName + " - Endrole = " + clientEnd.role);

		}
	}	
function publizise(package){
	var elements = package.elements;
	for(var i = 0; i < elements.count; i++){
		var element = elements.getat(i);
		Session.Output("Element: " + element.name );

		for(var j = 0; j < element.attributes.count; j++){
			var attribute = element.attributes.getat(j);
			Session.Output("    Attribute: " + attribute.name + " has visibility : " + attribute.visibility);

			if (attribute.visibility != 'Public')	{
				attribute.visibility = 'Public'
				attribute.Update();
				Session.Output("    - setting visibility = 'Public'");}
			else {Session.Output("    - doing nothing");} 

			}

			var elementConnectors = element.connectors;
		//Session.Output(i + "  Element: " + elementName + "(" + elementConnectors.count + " connectors;   ElementID: " + element.elementID)
		for(var k = 0; k < elementConnectors.count; k++){
			var connector = elementConnectors.getat(k);
			//apparently, supplierEnd denotes the Target role...
			Session.Output("        ConnectorEnd: " + connector.clientEnd.role + " has visibility : " + connector.clientEnd.visibility);

			if (connector.clientEnd.visibility != 'Public')	{
				connector.clientEnd.visibility = 'Public';
				Session.Output("        - setting visibility = 'Public'");}
			else {Session.Output("        - doing nothing");} 

			Session.Output("        ConnectorEnd: " + connector.supplierEnd.role + " has stereotype : " + connector.supplierEnd.stereotypeEx);

			if (connector.supplierEnd.visibility != 'Public')	{
				connector.supplierEnd.visibility = 'Public';
				Session.Output("        - setting visibility = 'Public'");}
			else {Session.Output("        - doing nothing");} 
			connector.Update();

			}

		}
	}

function ConnectorNameToTargetRoleName(package, removeAttName){


	Session.Output("Working on package " + package.name);

	//Tag elements
	var elements = package.elements;
	for(var i = 0; i < elements.count; i++){
		var element = elements.getat(i);
		var elementName = element.name;

		//Tag connectorEnds
		var elementConnectors = element.connectors;
		Session.Output("  Element: " + elementName + "(" + elementConnectors.count + " connectors)")
		for(var j = 0; j < elementConnectors.count; j++){
			var connector = elementConnectors.getat(j);
			var connectorName = connector.name;
			var connectorStereotype = connector.stereotypeEx;
			//apparently, supplierEnd denotes the Target role...
			if ((element.elementId != connector.supplierId) || (connector.supplierId == connector.clientId) ){
				connector.supplierEnd.role = connectorName;
				connector.supplierEnd.stereotypeEx = "ObjectProperty," + connectorStereotype; 
				//connector.supplierEnd.Update();
				if (removeAttName == 3 ){
					connector.name = "";
					connector.stereotypeEx = "";}
				connector.Update();
				Session.Output("    Moving connector: " + connectorName );
				}



		}
	}	

}
